import React from 'react'

const Register = ({ workshops }) => {
    const roles = [
        {
            id: 1,
            name: 'Estudiante'
        },
        {
            id: 2,
            name: 'Profesor'
        },
        {
            id: 3,
            name: 'Director'
        }
    ]

    return (
        <div>
            <form>
                <div>
                    username: <input />
                </div>
                <div>
                    password: <input type='password' />
                </div>
                <div>
                    <label>Rol:</label>
                    <select>
                        {roles.map(role => role.name)}
                    </select>
                </div>
                <div>
                    <label>Semillero:</label>
                    <select>
                        {workshops.map(workshop => <option>{workshop.name}</option>)}
                    </select>
                </div>
            </form>
        </div>
    )
}

export default Register;
